import React, { useEffect, useState } from 'react';
import { request } from '../axios_helper';

function Profiles() {
  const [profiles, setProfiles] = useState([]);

  useEffect(() => {
    request('get', '/profiles')
      .then(response => {
        setProfiles(response.data);
      })
      .catch(error => {
        console.error(error);
      });
  }, []);

  return (
    <div className="max-w-screen-xl mx-auto p-4">
      <h1 className="text-2xl font-bold mb-4">Мои профили</h1>
      {profiles.map(profile => (
        <div key={profile.id} className="bg-white rounded-lg p-4 mb-4 shadow">
          <div className="mb-2">
            <span className="font-bold">Адрес:</span> {profile.address}
          </div>
          <div className="mb-2">
            <span className="font-bold">Телефон:</span> {profile.telephone}
          </div>
          <div className="mb-2">
            <span className="font-bold">Фамилия:</span> {profile.surname}
          </div>
          <div className="mb-2">
            <span className="font-bold">Имя:</span> {profile.firstname}
          </div>
        </div>
      ))}
    </div>
  );
}

export default Profiles;
